import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

export default function Expenses({ data }) {
  return (
    <div className="expenses">
      {data.forEach((element) => {
        return (
          <ExpenseItem
            title={element.title}
            date={element.date}
            amount={element.amount}
          ></ExpenseItem>
        );
      })}
    </div>
  );
}
